import './home.css';
import React from 'react'

import PaperRow from './paper-row'

function Home() {
        var papers = [
            {
                title: 'The effect of dielectric environment on the neutral and charged dark excitons in WSe2 monolayer',
                author: 'Dr. Arjun \'Bezos Beta\' Khorana',
                id: 1
            }, 
            {
                title: 'Article 2',
                author: 'Dr. Arjun \'Bezos Beta\' Khorana',
                id: 2
